www.gunbroker.com Listing #: 328202566

Condition: Factory New

Whether you are looking for a pistol for affordable training or simply the excitement of shooting, the P22 is the pistol for you. The WALTHER P22 is fascinating in its compact size, while still maintaining all of the features of a full-size pistol. Constructed using a modular manufacturing concept, the P22 offers several different equipment configurations. The barrel can be changed out or a red dot sight can be mounted--almost instantly. 

Features of the P22
•Interchangeable frame back straps create an ideal fit to the shooter's hand; 
•Compact design and light-weight are achieved by a modern polymer frame (just 480 grams, including the magazine); 
•Traditional double-action operation 
•Ambidextrous controls for both left and right hand shooters; 
•Magazine disconnect, hammer safety and firing pin safety for safe and reliable operation; 
•Modern, eye catching high tech design; 
•Fixed barrel for incredible accuracy; 
•Windage adjustable rear sight and elevation adjustment with interchangeable front sights for variations in shooter operation; 
•Interchangeable barrel (sold separately) can convert the P22 from the standard; configuration to the target version in minutes 
•Includes 1 Magazine; 

SPECIFICATIONS - Model: P22; Caliber: .22LR; Barrel Length: 5"; Dimensions L/H/W: 7.8"/4.5"/1.1"; Weight (without Mag): 18.7 oz.; Sights: 3-Dot adj.; Magazine Capacity: 10 Rounds; Trigger: DA/SA; Trigger Weight: 11 lbs./4 lbs.; 

Firearms Return Policy: 
VERY IMPORTANT - Please take your time to inspect all firearms thoroughly before proceeding with the firearms transfer process. Once a new firearm is transferred to you it is considered used, even if unfired. Consequently, we cannot provide a full refund for new firearms once they have been transferred into your possession. Also, we DO NOT reimburse FFL transfer fees on cancelled or refused firearms. We do understand that some manufacturer defects may not be identifiable upon initial inspection. However, upon discovering a defect after the transfer, the firearm must be returned directly to the manufacturer for replacement or repair (in accordance with the manufacturer’s warranty policy). By sending a defective firearm directly to the manufacturer, you can avoid the unnecessary transfer fees of returning the firearm to us through your local FFL dealer. Manufacturer repaired firearms can be returned directly to the customer without additional FFL transfer or associated fees. However, if the manufacturer chooses to replace the firearm, the replacement firearm must transfer through your local FFL dealer to document the replacement firearm serial number. Shooting Sports Outlet, Inc. will provide your choice of a replacement item (pending availability) or a full refund and pay the return shipping cost on all firearms that are found to be defective upon receipt. Please be aware that a 15% restocking fee may apply on all refused or cancelled orders and on any order that is shipped and later found to conflict with local laws. All returns and/or exchanges must have prior approval. All returns must be in original condition as to when they left Shooting Sports Outlet, Inc. All return shipping charges involved in the return of refused or cancelled orders are the sole responsibility of the customer. 

WE GLADLY ACCEPT – VISA / MASTERCARD / DISCOVER!

